◆商品詳細◆<br><br>
ACアダプターで高速充電しているときは速く、PCのUSB端子などでは遅く流れます。<br>
満充電に近づくと流れがゆっくりになるので、充電が終わりそうなタイミングもわかります。<br><br>
充電が終了するとケーブルの光が消えます。<br>
画面を見なくてもケーブルの光で充電具合がわかります。機能的で使えます！<br><br>

●ファッション的で機能的！<br>
●機器の充電が始まるとケーブルに光が流れます。<br>
●ケーブルの光はiPhone、iPadに向けて流れるように動きます。かっこいいです！<br>
●暗い場所でもどこで充電されているかわかります。<br>
●車中で使用すると眼を引くこと間違いなし！<br>
●ケーブルとパソコンと繋ぐことで同期させることができます。<br><br>
■ケーブルの長さ：80cm<br>
■保証期間：3ヵ月間
